import React from 'react';

const Rank = ({name ,entries}) => {
	return(
		<div>
			<div className='near-black f3'>
				{'${name}, your current rank is:'}
			</div>
			<div className='near-black f1'>
				{entries}
			</div>
		</div>	
	);
}

export default Rank;
